		oProduction: function (oEvent) {
			this._productionfragment().open();
			// Remember selections if required
			var bMultiSelect = !!oEvent.getSource().data("multi");
			this._oDialog.setMultiSelect(bMultiSelect);

			//add Clear button if needed
			var bShowClearButton = !!oEvent.getSource().data("showClearButton");
			this._oDialog.setShowClearButton(bShowClearButton);

		},
		_productionfragment: function () {
			if (!this._oDialog) {
				// create dialog via fragment factory
				var sId = this.createId("helloDialog"),
					oView = this.getView();
				this._oDialog = sap.ui.xmlfragment(sId, "Showroom.CarShowroom.Fragment.serviceproduction", this);
				oView.addDependent(this._oDialog);
			}

			return this._oDialog;
		},
